import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import FormRegistration from './registration_form';

/*
1. Створіть реєстраційну форму. Користувач повинен вводити: нік, електронна адреса, стать, вік.
Використовуйте можливості React для роботи з формами. Використовуйте React для валідації, введених
значень.
2. Створіть форму, щоб завантажити фотографію. Користувач повинен вводити: нік, пароль, електронну адресу,
фотографію, опис фотографії, теги. Використовуйте
можливості React для роботи з формами. Використайте React для валідації, введених значень.
3. Створіть програму для відображення інформації
про міста вашої країни. Обов'язково потрібно викоритати масиви об'єктів та функцію map
4. Створіть програму для відображення інформації
про ваші улюблені музичні групи. Обов'язково потрібно використовувати масиви об'єктів, функцію
map та класові компоненти.
*/
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
    <FormRegistration/>
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
